import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on Electronics category to ensure we have products to sort
    await page.waitForSelector('div.category-card:has-text("Electronics")', { timeout: 5000 });
    await page.click('div.category-card:has-text("Electronics")');

    // Wait for sort controls to appear
    await page.waitForSelector('.sort-filter-controls', { timeout: 5000 });

    // Apply price sort filter (low to high)
    await page.selectOption('#sortSelect', 'price-low');

    // Wait for sorting to complete
    await page.waitForTimeout(1000);

    // Take screenshot after applying sort
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_sorted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_sorted.png'));

    // Verify the sort was applied by checking the select value
    const sortValue = await page.$eval('#sortSelect', select => select.value);

    return {
      success: true,
      action: "Applied price sort filter (low to high)",
      extractedData: {
        sortValue: sortValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price sort filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
